
public class Task01 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println(Multiple(5));
		
	}
	/*
	 * 1. funkcija ce primati parametar tipa int, a kao povratni parametar ce takodje imati int
	 *  i vracati ce kvadrat broja koji predan kao parametar.
	 */

	
	public static int Multiple(int num){
		int square;
		return square = num * num;
	}
	public static double Multiple(double num){
		double square;
		return square = num * num;
	}
	public static int Multiple(int num1, int num2){
		int product = num1*num2;
		return product;
	}
	public static double Multiple(double num1, double num2){
		double product = num1*num2;
		return product;
	}
}